    <script>
  (function(window, undefined)
  {
    var class2type = {}, core_version = "1.10.2", core_toString = class2type.toString, core_trim = core_version.trim, jQuery = function(selector, context){};
    jQuery.fn = jQuery.prototype = {};
    jQuery.extend = jQuery.fn.extend = function()
    {
      var copy, name, options, target, i = 1, length = arguments.length, deep = false;
      if(length === i)
      {
        target = this;
        --i;
      }

      for(;i < length;i++)
      {
        if((options = arguments[i]) != null)
        {
          for(name in options)
          {
            copy = options[name];
            if(deep);
            else if(copy !== undefined)
            {
              target[name] = copy;
            }
          }
        }
      }
    };
    jQuery.extend({
      expando: "jQuery" + (core_version + Math.random()).replace(/\D/g, ""), 
      noConflict: function(deep){}, 
      isReady: false, 
      readyWait: 1, 
      holdReady: function(hold){}, 
      ready: function(wait){}, 
      isFunction: function(obj)
      {
        return jQuery.type(obj) === "function";
      }, 
      isArray: Array.isArray || function(obj){}, 
      isWindow: function(obj){}, 
      isNumeric: function(obj){}, 
      type: function(obj)
      {
        if(obj == null)
        {
          return String(obj);
        }

        return typeof obj === "object" || typeof obj === "function" ? class2type[core_toString.call(obj)] || "object" : typeof obj;
      }, 
      isPlainObject: function(obj){}, 
      isEmptyObject: function(obj){}, 
      error: function(msg){}, 
      parseHTML: function(data, context, keepScripts){}, 
      parseJSON: function(data){}, 
      parseXML: function(data){}, 
      noop: function(){}, 
      globalEval: function(data){}, 
      camelCase: function(string){}, 
      nodeName: function(elem, name){}, 
      each: function(obj, callback, args)
      {
        var i = 0, length = obj.length, isArray = isArraylike(obj);
        if(args);
        else 
        {
          if(isArray)
          {
            for(;i < length;i++)
            {
              callback.call(obj[i], i, obj[i]);
            }
          }
        }
      }, 
      trim: core_trim && !(core_trim.call("\uFEFF\xA0")) ? function(text){} : 0, 
      makeArray: function(arr, results){}, 
      inArray: function(elem, arr, i){}, 
      merge: function(first, second){}, 
      grep: function(elems, callback, inv){}, 
      map: function(elems, callback, arg){}, 
      guid: 1, 
      proxy: function(fn, context){}, 
      access: function(elems, fn, key, value, chainable, emptyGet, raw){}, 
      now: function(){}, 
      swap: function(elem, options, callback, args){}
    });
    jQuery.each("Boolean Number String Function Array Date RegExp Object Error".split(" "), function(i, name)
    {
      class2type[("[object " + name) + "]"] = name.toLowerCase();
    });
    function isArraylike(obj)
    {
      var length = obj.length, type = jQuery.type(obj);
      return type === "array" || (type !== "function" && (length === 0 || (typeof length === "number" && length > 0 && (length - 1) in obj)));

<body id="body" style="">
<div id="qunit"></div>

<dl id="dl" style="position:absolute;top:-32767px;left:-32767px;width:1px;">

</dl>

<script>
  var mystr, myarr, myfunction, fn, obj, nodes, first, input, a;
  assert(!(jQuery.isFunction()), "No Value");
  assert(!(jQuery.isFunction(null)), "null Value");
  assert(!(jQuery.isFunction(undefined)), "undefined Value");
  assert(!(jQuery.isFunction("")), "Empty String Value");
  assert(!(jQuery.isFunction(0)), "0 Value");
  assert(jQuery.isFunction(String), ("String Function(" + String) + ")");
  assert(jQuery.isFunction(Array), ("Array Function(" + Array) + ")");
  assert(jQuery.isFunction(Object), ("Object Function(" + Object) + ")");
  assert(jQuery.isFunction(Function), ("Function Function(" + Function) + ")");
  mystr = "function";
  assert(!(jQuery.isFunction(mystr)), "Function String");
  myarr = ["function"];
  assert(!(jQuery.isFunction(myarr)), "Function Array");
  myfunction = {};
  assert(!(jQuery.isFunction(myfunction)), "Function Object");
  fn = function(){};
  assert(jQuery.isFunction(fn), "Normal Function");
  obj = document.createElement("object");
  assert(!(jQuery.isFunction(obj)), "Object Element");
  nodes = document.body.childNodes;
  assert(!(jQuery.isFunction(nodes)), "childNodes Property");
  first = document.body.firstChild;
  assert(!(jQuery.isFunction(first)), "A normal DOM Element");
  input = document.createElement("input");
  document.body.appendChild(input);
  document.body.removeChild(input);
  a = document.createElement("a");
  a.href = "some-function";
  document.body.appendChild(a);
  assert(!(jQuery.isFunction(a)), "Anchor Element");
  document.body.removeChild(a);
  function callme(callback)
  {
    function fn(response)
    {
      callback(response);
    }
    assert(jQuery.isFunction(fn), "Recursive Function Call");
    fn({});
  }
  callme(function()
  {
    callme(function(){});
  });
</script>


</body>
